message:
A Situação agora é a seguinte.

Não podemos deixar os 1200 ao relento.

Patriotas... Somos pelo menos 57 milhões.

1200 não ficarão para trás.

Vamos liberta-los nem que seja na marra.

Pára tudo!

Caminhoneiros;
Funcionários;
Empresários;
Transporte público;
Hospitais;
Polícias;
Supermercados.

Se não libertarem os 1200... Temos de atropelar todos.

Infelizmente, estão pedindo.

Se estão pedindo... Terão!

